INSERT INTO `message_of_day` (`id`, `message`, `created_by`, `creation_date`, `message_of_day_active`) VALUES
(1, 'Mahatma Gandhi Jayanti', 2, '2014-10-02 13:03:17', 0),
(2, 'Throughout the day I find myself having to give explanations or corrections to so many people. When I do this I find that I have to spend a lot of words. In the process I tend to lose a lot of my energy and find myself tired.In order to save my energy and to use fewer words I need to have the balance of love and discipline. Discipline will enable me to give the right directions while love will make my directions effective. So I find that just a few words would be enough to get my message across.I need to have the balance of love and discipline. Discipline will enable me to give the right directions while love will make my directions effective. So I find that just a few words would be enough to get my message across', 2, '2014-10-03 11:20:36', 1);
